import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Signup from './Signup'; // assuming Signup is in the same directory

function App() {
 return (
   <Router>
     <Routes>
       <Route path="/signup" element={<Signup />} />
       {/* other routes */}
     </Routes>
   </Router>
 );
}

export default App;
